Which is the graph of $y = f \left( \frac{1 - x}{2} \right)$?

[asy]
unitsize(0.3 cm);

picture[] graf;
int i, n;

real func(real x) {
  real y;
  if (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
  return(y);
}

real funcb(real x) {
  return(func((1 - x)/2));
}

